public class Solution {
    public int MinimumBeautifulSubstrings(string s) {
        const int INF = int.MaxValue;
        int n = s.Length;
        int[] dp = new int[n + 1];
        Array.Fill(dp, INF);
        dp[0] = 0; // base case

        for (int i = 0; i < n; i++) {
            if (s[i] == '0') continue; // skip leading zeros
            long num = 0;
            for (int j = i; j < n; j++) {
                num = num * 2 + (s[j] - '0');
                if (IsPowerOf5(num)) {
                    if (dp[i] != INF) {
                        dp[j + 1] = Math.Min(dp[j + 1], dp[i] + 1);
                    }
                }
            }
        }

        return dp[n] == INF ? -1 : dp[n];
    }

    private bool IsPowerOf5(long num) {
        while (num > 1) {
            if (num % 5 != 0) return false;
            num /= 5;
        }
        return num == 1;
    }
}
